import React from 'react';

const Sidebar = () => {
  return (
    <aside className="bg-gray-900 text-white w-64 p-6 shadow-md transform transition-transform duration-300 ease-in-out">
      <h2 className="text-xl font-bold mb-6">Navigation</h2>
      <ul className="space-y-6">
        <li><a href="/main" className="hover:text-blue-400 transition-colors">Dashboard</a></li>
        <li><a href="#" className="hover:text-blue-400 transition-colors">Data Visualization</a></li>
        <li><a href="#" className="hover:text-blue-400 transition-colors">Manage Data</a></li>
      </ul>
    </aside>
  );
};

export default Sidebar;
